import React, { PureComponent } from 'react';
import '../assets/css/Dashboard.css';
const {PieChart,
       Pie,
       Legend,
       Tooltip} = Recharts;


class PieGraphCard extends PureComponent {

  render() {

    const { graphData } = this.props;

    return (

      <div className="card-big-container">
        <div className="card-title"> Follower Region Distribution </div>
        <ResponsiveContainer width={290} height="75%" className="chart-container">
          <PieChart width={800} height={400}>
            <Pie isAnimationActive={false} data={graphData} cx={200} cy={200} outerRadius={80} fill="#8884d8" label/>
            <Tooltip/>
         </PieChart>
       </ResponsiveContainer>
      </div>
    )

  }

}



export default PieGraphCard;
